import React from "react";
import PhoneIcons from "../assets/images/RE4q5Ja.webp";

const DriveMain = () => {
  return (
    <div>
      <div className="bg-drive-bg block pb-4 pl-20 pt-20 text-center md:text-start md:flex justify-between">
        <div className="pb-3 md:pb-0">
          <div className="text-3xl md:text-4xl text-drive mx-8 font-bold">
            OneDrive Personal Cloud Storage
          </div>
          <div className="mx-8">
            Save your photos and files to OneDrive and access them from any
            device, anywhere.
          </div>
          <a href="/">
            <button>Sign in</button>
          </a>
          <a href="" className="">
            <button>See plans and pricing</button>
          </a>
        </div>
        <div className="">
          <img src={PhoneIcons} alt="logo" className="" />
        </div>
      </div>
    </div>
  );
};

export default DriveMain;
